import React from 'react';
import Header from './Header';

const SignUpPage = () => {
  return (
    <div>
      <Header />
      <div className="absolute">
        <img src="https://assets.nflxext.com/ffe/siteui/vlv3/9f46b569-aff7-4975-9b8e-3212e4637f16/73a98c7c-6a61-4525-be3b-4ff28cd22c70/RO-en-20240415-popsignuptwoweeks-perspective_alpha_website_large.jpg"
          alt="logo" />
      </div>
   

<div className='absolute inset-0 flex flex-col items-center justify-center text-white'>
  <p className="text-white mt-2 font-bold text-5xl p-2 m-2">
          Unlimited movies, TV shows, and more. 
        </p>
        <p className='text-white text-xl font-bold p-2 m-2'>Watch anywhere. Cancel anytime.</p>
      </div>
    </div>
  );
};

export default SignUpPage;
